import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';
const Note = ()=>{
  return <>
  <div className='note'>
    <h1>Title</h1>
    <br/>
    <p>This is a content</p>
   
  </div>
  </>
}
export default Note;
